You are tasked with creating a Python function that processes a JSON object representing network configuration data. The function should extract specific information from the JSON and perform a transformation on it. The JSON object represents network configuration data and has the following structure: 
{
    "vpn-binding": {
        "ip-address": "192.168.1.100"
    },
    "network-id": "12345",
    "admin-state-up": "true",
    "neutron-binding:vnic-type": "normal",
    "neutron-binding:host-id": "host123",
    "neutron-binding:vif-details": [
        {
            "details-key": "port_filter",
            "value": "true"
        }
    ]
}

You need to create a Python function `process_network_config(json_data)` that takes the JSON object as input and performs the following tasks:
1. Extract the IP address from the "vpn-binding" section.
2. Extract the "network-id".
3. Extract the "admin-state-up" value.
4. Extract the "neutron-binding:host-id".
5. Check if there is a "neutron-binding:vif-details" section with "details-key" as "port_filter" and "value" as "true". If found, return True; otherwise, return False. The function should return a tuple containing the extracted values in the order of (ip_address, network_id, admin_state_up, host_id, port_filter_true).

You are tasked with creating a Python function that processes a list of dictionaries containing model names and lists of corresponding seed data. The function should combine the data into a single data structure and return the combined data. Each dictionary in the input list has a 'model_name' key indicating the name of the model and a 'data' key containing a list of dictionaries representing the seed data for that model. Your function should return a dictionary where each key is the model name and each value is the list of corresponding seed data. The function signature should be: 
def process_seed_data(relation_seeds):
    # Your implementation here
    pass

Example:
For the following input:
relation_seeds = [
    {'model_name': 'teams.league', 'data': [{'id': 1, 'name': 'Premier League'}, {'id': 2, 'name': 'La Liga'}]},
    {'model_name': 'teams.team', 'data': [{'id': 1, 'name': 'Manchester United'}, {'id': 2, 'name': 'Real Madrid'}]}
]
The function process_seed_data(relation_seeds) should return:
{
    'teams.league': [{'id': 1, 'name': 'Premier League'}, {'id': 2, 'name': 'La Liga'}],
    'teams.team': [{'id': 1, 'name': 'Manchester United'}, {'id': 2, 'name': 'Real Madrid'}]
}

You are tasked with processing a list of employee IDs and retrieving their corresponding details from a predefined employee database. The employee details are stored in a dictionary where the employee ID is the key and the value is another dictionary containing the employee's 'Name', 'Department', and 'Salary'. Write a function `get_employee_info(employee_ids: List[str]) -> List[Dict[str, Union[str, int]]]` that takes a list of employee IDs and returns a list of dictionaries with the details of the employees. If an employee ID is not found in the database, the corresponding dictionary should be empty. The function should return the employee details in the same order as the input list. Here is a sample employee database:

```python
database = {
    'E001': {'Name': 'John Doe', 'Department': 'Engineering', 'Salary': 60000},
    'E002': {'Name': 'Jane Smith', 'Department': 'Marketing', 'Salary': 55000},
    'E003': {'Name': 'Michael Johnson', 'Department': 'Finance', 'Salary': 65000}
}
```

You are given two sets of eigenvalues for a material's band structure, represented as nested lists within dictionaries. Each eigenvalue is a pair of values, where the first value represents the energy level and the second value represents the momentum. Your task is to compare the two sets of eigenvalues and calculate the total difference in energy levels and momenta for the eigenvalues labeled '1' in both dictionaries. Write a function `calculate_eigenvalue_difference(data1, data2)` that takes in two dictionaries `data1` and `data2` as input. Each dictionary has the following structure: 

```
data = {
    "output": {
        "eigenvalues": {
            "1": [
                [[energy1, momentum1], [energy2, momentum2], ...],
                [[energy1, momentum1], [energy2, momentum2], ...],
                ...
            ],
            ...
        }
    }
}
``` 
The function should return the sum of the absolute differences between the corresponding energy and momentum values in the eigenvalues labeled '1'.
